const Header = () => {
    var counter = 0

    const Increment = () => {
        counter += 1
    }
    return ( 
        <div>   
            <h1>Counter</h1>
            <p>{counter}</p>
            <button onClick={() => Increment()}>Increment by one</button>
        </div>
    );
}

export default Header;
